  input: 'TEXT,F3XN,,"Dear Mr. Maxwell:    Here is the Indiana Democratic Congressional
    Victory Committee''s 2001 Mid Year Report.  It''s our first attempt at e-filing,
    so I hope everything is provided in the appropriate format and location. ------
    We had an issue with our Schedule H-2 that I would like to clarify.  We first
    entered all our events in the Schedlue H-2.  After that we imported our Schedule
    H-4.  During the import of the Schedule H-4 the same events were again added to
    our Schedule H-2 (i.e.  Circle Club 01 - Circle Club 2001 -------- IDP Golf Outting
    2001 - IDP Open 01).  After noticing this duplication of reporting, we tried to
    delete the duplicate events, but were not allowed to by the software.  So, please
    note that these similiarly worded events are actually the same event.  All the
    events are new events, except IDEA 2000, which is the same as previously reported.   --------------
    Other than that issue, I hope everything is to you satisfaction.           "'
